import React, { useState, useEffect } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { solid } from "@fortawesome/fontawesome-svg-core/import.macro"; // <-- import styles to be used
import { cat } from "../Data/staticMarkData.json";
import ButtonBuild from "../temps/buttonBuild";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

export default Marketplace = (props) =>  {

    let [alwayHold, setAlways] = useState([]);
    let [data, setData] = useState([]);
  //org state
  state = {
    userId: "",
    user: "",
    hashPass: "",
    errors: [],
    nutrition: cat.nutrition,
    athletics: cat.athletics,
    misc: cat.misc,
    fullArray: [...cat.nutrition, ...cat.athletics, ...cat.misc],
  };


  useEffect(() => {
    const { context } = this.props;
    const auth = context.authenticatedUser;
    const hashPass = context.hashPass;
    console.log(hashPass);
      //holds all data forever
      setAlways(fullArray);

      //set and sorts to Des
      setData(
        fullArray.sort((a, b) => {
          let fa = a.name.toLowerCase(),
            fb = b.name.toLowerCase();

          if (fa < fb) {
            return -1;
          }
          if (fa > fb) {
            return 1;
          }
          return 0;
        })
      );
      if (auth) {
        console.log(auth);
        this.setState({
          userId: auth.id,
          user: auth,
          hashPass: hashPass,
        });
      }
    }, []);

  //page
    const { fullArray } = this.state;
    const results = [];

    return (
      <div style={{ backgroundColor: "#001220" }} className="text-center">
        <div
          className="spacer layer3 d-grid justify-content-center align-items-center grid-wrap"
          style={{ margintop: "3em" }}
        >
          <span
            className="sho rounded-pill"
            style={{
              width: "35vw",
              backgroundColor: "#001220",
              position: "relative",
              right: ".8%",
              top: "-45.5%",
            }}
          >
            <h1 style={styles.title}>FANIMISS</h1>
          </span>
        </div>
        <div
          className="d-grid justify-content-center align-items-center grid-wrap"
          style={{ position: "relative", bottom: "25vh" }}
        >
          <div
            className="rounded-pill d-grid justify-content-center align-items-center grid-wrap"
            style={{
              width: "76vw",
              height: "13vh",
              backgroundColor: "rgb(35 52 72)",
            }}
          >
            <div
              className="sho rounded-pill"
              style={{
                position: "relative",
                width: "74vw",
                backgroundColor: "rgb(76 104 133)",
                height: "10vh",
                bottom: 3,
              }}
            >
              <input></input>

              <ButtonBuild
                              buildN={this.buildN}
                              buildAT={this.buildAT}
                              buildA={this.buildA}
                              buildM={this.buildM}
                              next={this.next}/>
            </div>
          </div>
          <div
            className="rounded-5 d-grid justify-content-center align-items-center grid-wrap"
            style={{
              width: "76vw",
              height: "80vh",
              backgroundColor: "rgb(35 52 72)",
              marginTop: "5vh",
            }}
          >
            <div
              className="sho rounded-5 d-flex justify-content-center align-items-center flex-wrap"
              style={{
                position: "relative",
                width: "74vw",
                backgroundColor: "rgb(76 104 133)",
                height: "77vh",
                bottom: 3,
              }}
            >

              <div style={{ height: "100%", width: "0%" }}></div>


              <div className="container">

                <div className="row">
                  {" "}
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                </div>
                <div className="row">
                  {" "}
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                </div>
                <div className="row">
                  {" "}
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                  <div class="col-sm">One of three columns</div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="spacer layer2"> </div>
        <div className="spacer layer3"></div>
        <div className="spacer layer1"></div>
      </div>
    );
  }

  buildN = () => {
    const nutritionR = document.getElementById('nutritionR')
    document.getElementById('span').style.height = "634.5em"
    const miscR = document.getElementById('miscR')
    const athleticsR = document.getElementById('athleticR')
    const allR = document.getElementById('allR')
    nutritionR.className = 'active-content'
    athleticsR.className = 'not-content'
    allR.className = 'not-content'
    miscR.className = 'not-content'
  };

  buildM = () => {
    const nutritionR = document.getElementById('nutritionR')
    document.getElementById('span').style.height = "134.5em"
    const miscR = document.getElementById('miscR')
    const athleticsR = document.getElementById('athleticR')
    const allR = document.getElementById('allR')
    miscR.className = 'active-content'
    athleticsR.className = 'not-content'
    allR.className = 'not-content'
    nutritionR.className = 'not-content'
  };

  buildAT = () => {
    const nutritionR = document.getElementById('nutritionR')
    document.getElementById('span').style.height = "634.5em"
    const miscR = document.getElementById('miscR')
    const athleticsR = document.getElementById('athleticR')
    const allR = document.getElementById('allR')
    athleticsR.className = 'active-content'
    miscR.className = 'not-content'
    allR.className = 'not-content'
    nutritionR.className = 'not-content'
  };

  buildA = () => {
    const nutritionR = document.getElementById('nutritionR')
    document.getElementById('span').style.height = "1384.6em"
    const miscR = document.getElementById('miscR')
    const athleticsR = document.getElementById('athleticR')
    const allR = document.getElementById('allR')
    allR.className = 'active-content'
    miscR.className = 'not-content'
    athleticsR.className = 'not-content'
    nutritionR.className = 'not-content'
  };

  next = () => {
    this.props.history.push("/reviews/toprated");
  };

const styles = {
  title: {
    backgroundImage:
      " url('https://media1.giphy.com/media/VOCwBp4kcegJ2rfCF7/giphy.gif?cid=790b7611802d3e1186bf825d92f34d30607f723a038efaee&rid=giphy.gif&ct=g')",
    backgroundPosition: "center center",
    backgroundRepeat: "no-repeat",
    backgroundSize: "100%",
    WebkitBackgroundClip: "text",
    WebkitTextFillColor: "transparent",
    fontFamily: "'Arimo', sans-serif",
    fontSize: "5vw",
    color: "white",
    textAlign: "center",

    position: "relative",
    top: "1.5vh",
  },
};
